import React, { useState } from 'react';
import { View, Text, Button } from 'react-native';

const ReactApp = () => {
  const [counter, setCounter] = useState(0);
  return (
    <View>
      <Text onPress = {() => {
        setCounter(counter + 1);
      }}>
        {counter}
      </Text>
    </View>
  )
}

export default ReactApp;
